INSERT INTO public.posts VALUES (225, 'Новость', 'Друзья, вчера обновили приложение и теперь в нем доступны голосования (доступно в разделе сервисов). Создать голосование может любой из зарегистрированных пользователей и настроить его, чтобы было доступно всем соседям в доме, либо только на свой подъезд, либо на свой этаж в подъезде.', '2020-12-07 11:02:24.909802+00', '2020-12-07 11:02:24.909802+00', 'news', NULL);
